import { IconFeedBack, IconSearch } from "../Icon/Icon";
const InformationBox = () => {
	return (
		<div className="infoWrapper">
			<div className="infoWrapperInner">
				<div className="wrapperTitleBox">
					<div className="title">
						{" "}
						<span>
							<IconFeedBack />
						</span>{" "}
						問題與討論
					</div>
					<div className="searchBox">
						<span>
							<IconSearch />
						</span>
					</div>
				</div>
			</div>
		</div>
	);
};

export default InformationBox;
